    false,nt"url": null,nt"notes": "Objectives of the 2012 SEAMAP Caribbean
    Reef Fish Survey were to assess relative abundance of reef fish species around the
    US Caribbean Islands, estimate length-frequency distributions of sampled species,
    collect otoliths from fish for age/growth analysis, collect conductivity, temperature,
    dissolved oxygen, fluorescence, and transmissivity data profiles of the water column
    at each sample site, and collect acoustic echosounder data with Simrad ME70 and
    EK60 echosounders at each sample site.",nt"license_title": null,nt"extras":
